import React from "react";
import { CssBaseline, Toolbar, AppBar, Typography } from "@mui/material";
const Header = () => {
  return (
    <>
      <CssBaseline />
      <AppBar position="relative">
        <Toolbar>
          <Typography variant="h5">Employer</Typography>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
